#include<stdio.h>
#include<stdlib.h>
#include<string.h>

int minSteps(char* s, char* t) {
    int sLen = strlen(s);
    int tLen = strlen(t);
    int *sArr = (int*)malloc(26 * sizeof(int));
    int *tArr = (int*)malloc(26 * sizeof(int));
    int count = 0;

    if(sLen != tLen)
        return -1;

    for(int i = 0;i < 26;i++)
    {
        sArr[i] = 0;
        tArr[i] = 0;
    }

    for(int i = 0;i < sLen;i++) {
        sArr[s[i] - 97]++;
    }
    
    for(int i = 0;i < tLen;i++) {
        tArr[t[i] - 97]++;
    }

    for(int i = 0;i < 26;i++) {
        if(sArr[i] != tArr[i]) {
            if(sArr[i] > tArr[i])
                count = count + sArr[i] - tArr[i];
            else
                count = count + tArr[i] - sArr[i];
        }
    }
    free(sArr);
    free(tArr);

    return count / 2;
}

int main()
{
    char *str1 = "anagram";
    char *str2 = "mangaar";

    //char *str1 = "";
    //char *str2 = "";

    printf("The minimum number of steps required to make the two strings the anagram of each other is %d\n", minSteps(str1, str2));

    return 0;
}